request.description:
### Create Itinerary

This endpoint allows the creation of a new itinerary.

#### Request Body

- `title` (string, required): The title of the itinerary.

- `destination` (string, required): The destination of the itinerary.

- `startDate` (string, required): The start date of the itinerary.

- `endDate` (string, required): The end date of the itinerary.


#### Response

The response is in JSON format and has the following schema:

``` json
{
    "type": "object",
    "properties": {
        "message": {
            "type": "string"
        },
        "itinerary": {
            "type": "object",
            "properties": {
                "id": {
                    "type": "integer"
                },
                "title": {
                    "type": "string"
                },
                "destination": {
                    "type": "string"
                },
                "startDate": {
                    "type": "string"
                },
                "endDate": {
                    "type": "string"
                },
                "userId": {
                    "type": "integer"
                },
                "updatedAt": {
                    "type": "string"
                },
                "createdAt": {
                    "type": "string"
                }
            }
        }
    }
}

 ```

### Get Itineraries

This endpoint retrieves a list of itineraries.

#### Request

- Method: GET

- URL: `{{baseUrl}}/api/v1/itineraries`


#### Response

The response for this request can be represented as a JSON schema:

``` json
{
  "type": "object",
  "properties": {
    "itineraries": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          // Add properties based on the actual response
        }
      }
    }
  }
}

 ```

### Get Itinerary Details

This endpoint retrieves the details of a specific itinerary.

#### Request

- Method: GET

- URL: `{{baseUrl}}/api/v1/itineraries/33`


#### Response

The response for this request follows the JSON schema below:

``` json
{
  "type": "object",
  "properties": {
    "itineraryId": {
      "type": "string"
    },
    "itineraryName": {
      "type": "string"
    },
    "itineraryDetails": {
      "type": "string"
    },
    "startDate": {
      "type": "string",
      "format": "date"
    },
    "endDate": {
      "type": "string",
      "format": "date"
    }
  }
}

 ```

### Delete Itinerary

This endpoint is used to delete a specific itinerary.

#### Request

- Method: DELETE

- Endpoint: `{{baseUrl}}/api/v1/itineraries/32`


#### Request Body

- { "title": "", "destination": "", "startDate": "", "endDate": ""


#### Response

The response of this request is documented as a JSON schema:

``` json
{
  "type": "object",
  "properties": {
    "message": {
      "type": "string"
    }
  }
}

 ```

### GET /api/v1/hotels/listHotels

This endpoint retrieves a list of hotels based on the provided geographical ID, check-in and check-out dates, and page number.

#### Request

- Method: GET

- Base URL: {{baseUrl}}

- Path: /api/v1/hotels/listHotels

- Query Parameters:

    - geoId (number, required): The geographical ID for the location of the hotels.

    - checkIn (string, required): The check-in date in the format 'YYYY-MM-DD'.

    - checkOut (string, required): The check-out date in the format 'YYYY-MM-DD'.

    - pageNumber (number, required): The page number for paginated results.


#### Response

The response is in JSON format and follows the schema below:

``` json
{
  "type": "object",
  "properties": {
    "message": {
      "type": "string"
    },
    "data": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string"
          },
          "title": {
            "type": "string"
          },
          "provider": {
            "type": "string"
          },
          "price": {
            "type": "string"
          },
          "photos": {
            "type": "array",
            "items": {
              "type": "object",
              "properties": {
                "__typename": {
                  "type": "string"
                },
                "sizes": {
                  "type": "object",
                  "properties": {
                    "__typename": {
                      "type": "string"
                    },
                    "maxHeight": {
                      "type": "number"
                    },
                    "maxWidth": {
                      "type": "number"
                    },
                    "urlTemplate": {
                      "type": "string"
                    }
                  }
                }
              }
            }
          },
          "rating": {
            "type": "object",
            "properties": {
              "count": {
                "type": "string"
              },
              "rating": {
                "type": "number"
              }
            }
          },
          "primaryInfo": {
            "type": ["string", "null"]
          }
        }
      }
    }
  }
}

 ```

#### Example Response

``` json
{
  "message": "",
  "data": [
    {
      "id": "",
      "title": "",
      "provider": "",
      "price": "",
      "photos": [
        {
          "__typename": "",
          "sizes": {
            "__typename": "",
            "maxHeight": 0,
            "maxWidth": 0,
            "urlTemplate": ""
          }
        }
      ],
      "rating": {
        "count": "",
        "rating": 0
      },
      "primaryInfo": null
    }
  ]
}

 ```

